  \"OMI/Aura TOMS-Like Ozone and Radiative Cloud Fraction Daily L3 Global 0.25x0.25
  deg V003\",\n\t\"tracking_summary\": {\n\t\t\"total\": 22,\n\t\t\"recent\": 3\n\t},\n\t\"groups\":
